INSERT INTO `Sentence_Translation` VALUES (1,' The wrath sing,  goddess, of Peleus\' son, Achilles, that destructive wrath which brought countless woes upon the Achaeans, and sent forth to Hades many valiant souls of heroes, and made them themselves spoil for dogs and every bird; thus the plan of Zeus came to fulfillment,  from the time when first they parted in strife Atreus\' son, king of men, and brilliant Achilles.'),(2,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.8'),(3,'  The son of Leto and Zeus; for he in anger against the king roused throughout the host an evil pestilence, and the people began to perish,  because upon the priest Chryses the son of Atreus had wrought dishonour. For he had come to the swift ships of the Achaeans to free his daughter, bearing ransom past counting; and in his hands he held the wreaths of Apollo who strikes from afar, on a staff of gold; and he implored all the Achaeans,  but most of all the two sons of Atreus, the marshallers of the people:'),(4,'  The son of Leto and Zeus; for he in anger against the king roused throughout the host an evil pestilence, and the people began to perish,  because upon the priest Chryses the son of Atreus had wrought dishonour. For he had come to the swift ships of the Achaeans to free his daughter, bearing ransom past counting; and in his hands he held the wreaths of Apollo who strikes from afar, on a staff of gold; and he implored all the Achaeans,  but most of all the two sons of Atreus, the marshallers of the people:'),(5,'  The son of Leto and Zeus; for he in anger against the king roused throughout the host an evil pestilence, and the people began to perish,  because upon the priest Chryses the son of Atreus had wrought dishonour. For he had come to the swift ships of the Achaeans to free his daughter, bearing ransom past counting; and in his hands he held the wreaths of Apollo who strikes from afar, on a staff of gold; and he implored all the Achaeans,  but most of all the two sons of Atreus, the marshallers of the people:'),(6,' \"Sons of Atreus, and other well-greaved Achaeans, to you may the gods who have homes upon Olympus grant that you sack the city of Priam, and return safe to your homes; but my dear child release to me, and accept the ransom  out of reverence for the son of Zeus, Apollo who strikes from afar.\"'),(7,' \"Sons of Atreus, and other well-greaved Achaeans, to you may the gods who have homes upon Olympus grant that you sack the city of Priam, and return safe to your homes; but my dear child release to me, and accept the ransom  out of reverence for the son of Zeus, Apollo who strikes from afar.\"'),(8,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.22-1.23'),(9,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.24-1.25'),(10,'  \"Let me not find you, old man, by the hollow ships, either tarrying now or coming back later, lest your staff and the wreath of the god not protect you.'),(11,' Her I will not set free. Sooner shall old age come upon her in our house, in Argos, far from her native land,  as she walks to and fro before the loom and serves my bed.'),(12,' Her I will not set free. Sooner shall old age come upon her in our house, in Argos, far from her native land,  as she walks to and fro before the loom and serves my bed.'),(13,'  But go, do not anger me, that you may return the safer.\" '),(14,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.33'),(15,'  He went forth in silence along the shore of the loud-resounding sea, and earnestly then, when he had gone apart, the old man prayed  to the lord Apollo, whom fair-haired Leto bore: \"Hear me, god of the silver bow, who stand over Chryse and holy Cilla, and rule mightily over Tenedos, Sminthian god, if ever I roofed over a temple to your pleasing, or if ever I burned to you fat thigh-pieces of bulls and goats,  fulfill this prayer for me:'),(16,'  He went forth in silence along the shore of the loud-resounding sea, and earnestly then, when he had gone apart, the old man prayed  to the lord Apollo, whom fair-haired Leto bore: \"Hear me, god of the silver bow, who stand over Chryse and holy Cilla, and rule mightily over Tenedos, Sminthian god, if ever I roofed over a temple to your pleasing, or if ever I burned to you fat thigh-pieces of bulls and goats,  fulfill this prayer for me:'),(17,'  He went forth in silence along the shore of the loud-resounding sea, and earnestly then, when he had gone apart, the old man prayed  to the lord Apollo, whom fair-haired Leto bore: \"Hear me, god of the silver bow, who stand over Chryse and holy Cilla, and rule mightily over Tenedos, Sminthian god, if ever I roofed over a temple to your pleasing, or if ever I burned to you fat thigh-pieces of bulls and goats,  fulfill this prayer for me:'),(18,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.42'),(19,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.43-1.45'),(20,'  The arrows rattled on the shoulders of the angry god as he moved, and his coming was like the night.'),(21,'  Then he sat down apart from the ships and let fly an arrow:'),(22,' terrible was the twang of the silver bow.'),(23,'  The mules he assailed first and the swift dogs,  but then on the men themselves he let fly his stinging shafts, and struck; and constantly the pyres of the dead burned thick.'),(24,'  The mules he assailed first and the swift dogs,  but then on the men themselves he let fly his stinging shafts, and struck; and constantly the pyres of the dead burned thick.'),(25,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.52'),(26,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.53-1.54'),(27,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.55'),(28,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.56'),(29,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.57-1.58'),(30,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.59-1.61'),(31,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.62-1.67'),(32,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.68'),(33,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.68-1.72'),(34,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.73'),(35,'  He with good intent addressed the gathering, and spoke among them: \"Achilles, dear to Zeus, you bid me declare the wrath of Apollo, the lord who strikes from afar.'),(36,'  Therefore I will speak; but take thought and swear that you will readily defend me with word and with might of hand; for I think I shall anger a man who rules mightily over all the Argives, and whom the Achaeans obey.'),(37,'  Therefore I will speak; but take thought and swear that you will readily defend me with word and with might of hand; for I think I shall anger a man who rules mightily over all the Argives, and whom the Achaeans obey.'),(38,'  Therefore I will speak; but take thought and swear that you will readily defend me with word and with might of hand; for I think I shall anger a man who rules mightily over all the Argives, and whom the Achaeans obey.'),(39,'  For mightier is a king, when he is angry at a lesser man.'),(40,'  Even if he swallows down his wrath for that day, yet afterwards he cherishes resentment in his heart till he brings it to fulfillment.'),(41,'  Even if he swallows down his wrath for that day, yet afterwards he cherishes resentment in his heart till he brings it to fulfillment.'),(42,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.84'),(43,' \"Take heart, and speak out whatever oracle you know;  for by Apollo, dear to Zeus, to whom you, Calchas, pray when you reveal oracles to the Danaans, no one, while I live and have sight on the earth, shall lay heavy hands on you beside the hollow ships, no one of the whole host of the Danaans,  not even if you name Agamemnon, who now claims to be far the best of the Achaeans.\" '),(44,' \"Take heart, and speak out whatever oracle you know;  for by Apollo, dear to Zeus, to whom you, Calchas, pray when you reveal oracles to the Danaans, no one, while I live and have sight on the earth, shall lay heavy hands on you beside the hollow ships, no one of the whole host of the Danaans,  not even if you name Agamemnon, who now claims to be far the best of the Achaeans.\" '),(45,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.92'),(46,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.93-1.96'),(47,' He will not drive off from the Danaans the loathsome pestilence, until we give back to her dear father the bright-eyed maiden, unbought, unransomed, and lead a sacred hecatomb to Chryse.'),(48,' Then we might appease and persuade him.\"'),(49,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.101'),(50,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.101-1.103'),(51,' With rage his black heart was wholly filled, and his eyes were like blazing fire.'),(52,'  To Calchas first of all he spoke, and his look threatened evil:'),(53,'  \"Prophet of evil, never yet have you spoken to me a pleasant thing; ever is evil dear to your heart to prophesy, but a word of good you have never yet spoken, nor brought to pass.'),(54,'  And now among the Danaans you claim in prophecy that for this reason the god who strikes from afar brings woes upon them,  that I would not accept the glorious ransom for the girl, the daughter of Chryses, since I much prefer to keep her in my home.'),(55,'  And now among the Danaans you claim in prophecy that for this reason the god who strikes from afar brings woes upon them,  that I would not accept the glorious ransom for the girl, the daughter of Chryses, since I much prefer to keep her in my home.'),(56,'  For certainly I prefer her to Clytemnestra, my wedded wife, since she is not inferior to her, either in form or in stature, or in mind, or in  any handiwork.'),(57,'  Yet even so will I give her back, if that is better; I would rather the people be safe than perish.'),(58,'  Yet even so will I give her back, if that is better; I would rather the people be safe than perish.'),(59,'  But provide me with a prize of honour forthwith, lest I alone of the Argives be without one, since that would not be proper.'),(60,' For you all see this, that my prize goes elsewhere.\"'),(61,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.121'),(62,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.122-1.123'),(63,'  We know nothing of a hoard of wealth in common store, but whatever we took by pillage from the cities has been apportioned,  and it is not seemly to gather these things back from the army.'),(64,'  We know nothing of a hoard of wealth in common store, but whatever we took by pillage from the cities has been apportioned,  and it is not seemly to gather these things back from the army.'),(65,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.127'),(66,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.127-1.129'),(67,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.130'),(68,'  \"Do not thus, mighty though you are, godlike Achilles, seek to deceive me with your wit; for you will not get by me nor persuade me.'),(69,' Are you willing, so that your yourself may keep your prize, for me to sit here idly in want, while you order me to give her back?  No, if the great-hearted Achaeans give me a prize,  suiting it to my mind, so that it will be worth just as much—but if they do not, I myself will come and take your prize, or that of Aias, or that of Odysseus I will seize and bear away.'),(70,' Are you willing, so that your yourself may keep your prize, for me to sit here idly in want, while you order me to give her back?  No, if the great-hearted Achaeans give me a prize,  suiting it to my mind, so that it will be worth just as much—but if they do not, I myself will come and take your prize, or that of Aias, or that of Odysseus I will seize and bear away.'),(71,' Are you willing, so that your yourself may keep your prize, for me to sit here idly in want, while you order me to give her back?  No, if the great-hearted Achaeans give me a prize,  suiting it to my mind, so that it will be worth just as much—but if they do not, I myself will come and take your prize, or that of Aias, or that of Odysseus I will seize and bear away.'),(72,'  Angry will he be, to whomever I come. But these things we will consider hereafter.'),(73,'  Let us now drag a black ship to the shining sea, and quickly gather suitable rowers into it, and place on board a hecatomb, and embark on it the fair-cheeked daughter of Chryses herself.  Let one prudent man be its commander, either Aias, or Idomeneus, or brilliant Odysseus,  or you, son of Peleus, of all men most extreme, so that on our behalf you may propitiate the god who strikes from afar by offering sacrifice.\"'),(74,'  Let us now drag a black ship to the shining sea, and quickly gather suitable rowers into it, and place on board a hecatomb, and embark on it the fair-cheeked daughter of Chryses herself.  Let one prudent man be its commander, either Aias, or Idomeneus, or brilliant Odysseus,  or you, son of Peleus, of all men most extreme, so that on our behalf you may propitiate the god who strikes from afar by offering sacrifice.\"'),(75,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.148'),(76,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.149-1.151'),(77,'  It was not on account of the Trojan spearmen that I came here to fight, since they have done no wrong to me.  Never have they driven off my cattle or my horses, nor ever in deep-soiled Phthia, nurse of men,  did they lay waste the harvest, for many things lie between us—shadowy mountains and sounding sea.'),(78,'  It was not on account of the Trojan spearmen that I came here to fight, since they have done no wrong to me.  Never have they driven off my cattle or my horses, nor ever in deep-soiled Phthia, nurse of men,  did they lay waste the harvest, for many things lie between us—shadowy mountains and sounding sea.'),(79,'  But you, shameless one, we followed, so that you might rejoice, seeking to win recompense for Menelaus and for yourself, dog-face, from the Trojans.'),(80,'  This you disregard, and take no heed of.'),(81,'  And now you threaten that you will yourself take my prize away from me, for which I toiled so much, which the sons of the Achaeans gave to me.'),(82,' Never have I prize like yours, whenever the Achaeans sack a well-inhabited citadel of the Trojans. The brunt of furious battle  do my hands undertake, but if ever an apportionment comes, your prize is far greater, while small but dear is the reward I take to my ships, when I have worn myself out in the fighting.'),(83,' Never have I prize like yours, whenever the Achaeans sack a well-inhabited citadel of the Trojans. The brunt of furious battle  do my hands undertake, but if ever an apportionment comes, your prize is far greater, while small but dear is the reward I take to my ships, when I have worn myself out in the fighting.'),(84,' Now I will go back to Phthia, since it is far better to return home with my beaked ships, nor do I intend  while I am here dishonoured to pile up riches and wealth for you.\" '),(85,' Now I will go back to Phthia, since it is far better to return home with my beaked ships, nor do I intend  while I am here dishonoured to pile up riches and wealth for you.\" '),(86,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.172'),(87,' \"Flee then, if your heart urges you; I do not beg you to remain for my sake.'),(88,'  With me are others who will honour me, and above all Zeus, the lord of counsel.'),(89,'  Most hateful to me are you of all the kings that Zeus nurtures, for  always strife is dear to you, and wars and battles.'),(90,'  Most hateful to me are you of all the kings that Zeus nurtures, for  always strife is dear to you, and wars and battles.'),(91,'  If you are very strong, it was a god, I think, who gave you this gift.  Go home with your ships and your companions and lord it over the Myrmidons; for you I care not,  nor take heed of your wrath. But I will threaten you thus:'),(92,'  If you are very strong, it was a god, I think, who gave you this gift.  Go home with your ships and your companions and lord it over the Myrmidons; for you I care not,  nor take heed of your wrath. But I will threaten you thus:'),(93,' as Phoebus Apollo takes from me the daughter of Chryses, her with my ship and my companions I will send back, but I will myself come to your tent and take the fair-cheeked Briseis, your prize, so that you will understand  how much mightier I am than you, and another may shrink from declaring himself my equal and likening himself to me to my face.\"'),(94,' as Phoebus Apollo takes from me the daughter of Chryses, her with my ship and my companions I will send back, but I will myself come to your tent and take the fair-cheeked Briseis, your prize, so that you will understand  how much mightier I am than you, and another may shrink from declaring himself my equal and likening himself to me to my face.\"'),(95,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.188'),(96,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.188-1.192'),(97,'  While he pondered this in mind and heart, and was drawing from its sheath his great sword, Athene came from heaven. The white-armed goddess Hera had sent her forth,  for in her heart she loved and cared for both men alike.'),(98,'  While he pondered this in mind and heart, and was drawing from its sheath his great sword, Athene came from heaven. The white-armed goddess Hera had sent her forth,  for in her heart she loved and cared for both men alike.'),(99,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.197-1.198'),(100,' Achilles was seized with wonder, and turned around, and immediately recognized Pallas Athene.'),(101,' Achilles was seized with wonder, and turned around, and immediately recognized Pallas Athene.'),(102,' Terribly her eyes shone.'),(103,'  Then he addressed her with winged words, and said:'),(104,' \"Why now, daughter of aegis-bearing Zeus, have you come?'),(105,' Is it so that you might see the arrogance of Agamemnon, son of Atreus?'),(106,' One thing I will tell you, and I think this will be brought to pass:'),(107,' through his own excessive pride shall he presently lose his life.\" '),(108,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.206'),(109,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.207-1.208'),(110,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.208-1.209'),(111,' But come, cease from strife, and do not grasp the sword with your hand.'),(112,'  With words indeed taunt him, telling him how it shall be.'),(113,' For thus will I speak, and this thing shall truly be brought to pass.'),(114,' Hereafter three times as many glorious gifts shall be yours on account of  this arrogance.'),(115,' But refrain, and obey us.\"'),(116,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.215'),(117,'  \"It is necessary, goddess, to observe the words of you two, however angered a man be in his heart, for is it better so.'),(118,'  Whoever obeys the gods, to him do they gladly give ear.\"'),(119,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.218'),(120,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.219-1.221'),(121,' She returned to Olympus to the palace of aegis-bearing Zeus, to join the company of the other gods.'),(122,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.223-1.224'),(123,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.225-1.228'),(124,' Indeed it is far better throughout the wide camp of the Achaeans to deprive of his prize whoever speaks contrary to you.'),(125,' Indeed it is far better throughout the wide camp of the Achaeans to deprive of his prize whoever speaks contrary to you.'),(126,'  People-devouring king, since you rule over nobodies; else, son of Atreus, this would be your last piece of insolence. But I will speak out to you, and will swear thereto a mighty oath:'),(127,'  People-devouring king, since you rule over nobodies; else, son of Atreus, this would be your last piece of insolence. But I will speak out to you, and will swear thereto a mighty oath:'),(128,' by this staff, that shall never more put forth leaves or shoots since first it left its stump among the mountains,  nor shall it again grow green, for the bronze has stripped it on all sides of leaves and bark, and now the sons of the Achaeans carry it in their hands when they act as judges, those who guard the ordinances that come from Zeus; and this shall be for you a mighty oath.'),(129,' by this staff, that shall never more put forth leaves or shoots since first it left its stump among the mountains,  nor shall it again grow green, for the bronze has stripped it on all sides of leaves and bark, and now the sons of the Achaeans carry it in their hands when they act as judges, those who guard the ordinances that come from Zeus; and this shall be for you a mighty oath.'),(130,' by this staff, that shall never more put forth leaves or shoots since first it left its stump among the mountains,  nor shall it again grow green, for the bronze has stripped it on all sides of leaves and bark, and now the sons of the Achaeans carry it in their hands when they act as judges, those who guard the ordinances that come from Zeus; and this shall be for you a mighty oath.'),(131,' by this staff, that shall never more put forth leaves or shoots since first it left its stump among the mountains,  nor shall it again grow green, for the bronze has stripped it on all sides of leaves and bark, and now the sons of the Achaeans carry it in their hands when they act as judges, those who guard the ordinances that come from Zeus; and this shall be for you a mighty oath.'),(132,' Surely some day a longing for Achilles will come upon the sons of the Achaeans  one and all, and on that day you will not be able to help them at all, for all your grief, when many shall fall dying before man-slaying Hector.'),(133,' Surely some day a longing for Achilles will come upon the sons of the Achaeans  one and all, and on that day you will not be able to help them at all, for all your grief, when many shall fall dying before man-slaying Hector.'),(134,' Surely some day a longing for Achilles will come upon the sons of the Achaeans  one and all, and on that day you will not be able to help them at all, for all your grief, when many shall fall dying before man-slaying Hector.'),(135,'  But you will gnaw the heart within you, in anger that you did no honour to the best of the Achaeans.\" '),(136,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.245-1.246'),(137,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.247'),(138,'  Then among them arose Nestor, sweet of speech, the clear-voiced orator of the Pylians, from whose tongue flowed speech sweeter than honey. Two generations of mortal men had passed away in his lifetime,  who had been born and reared with him before in sacred Pylos, and he was king among the third.'),(139,'  Then among them arose Nestor, sweet of speech, the clear-voiced orator of the Pylians, from whose tongue flowed speech sweeter than honey. Two generations of mortal men had passed away in his lifetime,  who had been born and reared with him before in sacred Pylos, and he was king among the third.'),(140,' He with good intent addressed the gathering and spoke among them:'),(141,' \"Comrades, great grief has come upon the land of Achaea. Truly would Priam and the sons of Priam  rejoice, and the rest of the Trojans would be most glad at heart, were they to hear all this of you two quarrelling, you who are chief among the Danaans in counsel and chief in war.'),(142,' \"Comrades, great grief has come upon the land of Achaea. Truly would Priam and the sons of Priam  rejoice, and the rest of the Trojans would be most glad at heart, were they to hear all this of you two quarrelling, you who are chief among the Danaans in counsel and chief in war.'),(143,'  Listen to me, for you are both younger than I. In earlier times I moved among men more warlike than you,  and never did they despise me.'),(144,'  Listen to me, for you are both younger than I. In earlier times I moved among men more warlike than you,  and never did they despise me.'),(145,'  Listen to me, for you are both younger than I. In earlier times I moved among men more warlike than you,  and never did they despise me.'),(146,' Such warriors have I never since seen, nor shall I see, as Peirithous was and Dryas, shepherd of the people, and Caeneus and Exadius and godlike Polyphemus, and Theseus, son of Aegeus, a man like the immortals.'),(147,'  Mightiest were these of men reared upon the earth; mightiest were they, and with the mightiest they fought, the mountain-dwelling centaurs, and they destroyed them terribly.'),(148,'  Mightiest were these of men reared upon the earth; mightiest were they, and with the mightiest they fought, the mountain-dwelling centaurs, and they destroyed them terribly.'),(149,'  With these men I had fellowship, when I came from Pylos, from a distant land far away; for they themselves called me.'),(150,'  With these men I had fellowship, when I came from Pylos, from a distant land far away; for they themselves called me.'),(151,'  And I fought on my own; with those men could no one fight of the mortals now upon the earth.'),(152,'  Yes, and they listened to my counsel, and obeyed my words.  So also should you obey, since to obey is