gainst might, for it is no common honour that is the portion of a sceptre-holding king, to whom Zeus gives glory. If you are a stronger fighter, and a goddess mother bore you,  yet he is the mightier, since he is king over more.'),(158,'  Neither do you, mighty though you are, take away the girl,  but let her be, as the sons of the Achaeans first gave her to him as a prize; nor do you, son of Peleus, be minded to strive with a king, might against might, for it is no common honour that is the portion of a sceptre-holding king, to whom Zeus gives glory. If you are a stronger fighter, and a goddess mother bore you,  yet he is the mightier, since he is king over more.'),(159,'  Son of Atreus, check your rage. Indeed, I beg you to let go your anger against Achilles, who is for all the Achaeans a mighty bulwark in evil war.\" '),(160,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.285'),(161,'  \"All these things, old man, to be sure, you have spoken as is right.'),(162,'  But this man wishes to be above all others; over all he wishes to rule and over all to be king, and to all to give orders; in this, I think, there is someone who will not obey. If the gods who exist for ever made him a spearman,  do they therefore license him to keep uttering insults?\"'),(163,'  But this man wishes to be above all others; over all he wishes to rule and over all to be king, and to all to give orders; in this, I think, there is someone who will not obey. If the gods who exist for ever made him a spearman,  do they therefore license him to keep uttering insults?\"'),(164,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.292'),(165,' \"Surely I would be called cowardly and of no account, if I am to yield to you in every matter that you say.  On others lay these commands, but do not give orders to me,  for I do not think I shall obey you any longer.'),(166,' \"Surely I would be called cowardly and of no account, if I am to yield to you in every matter that you say.  On others lay these commands, but do not give orders to me,  for I do not think I shall obey you any longer.'),(167,'  And another thing I will tell you, and take it to heart:'),(168,' with my hands I will not fight for the girl\'s sake either with you nor with any other, since you are taking away what you have given.'),(169,'  But of all else that is mine by my swift black ship,  nothing will you take or carry away against my will. Come, just try, so that these too may know:'),(170,'  But of all else that is mine by my swift black ship,  nothing will you take or carry away against my will. Come, just try, so that these too may know:'),(171,' forthwith will your dark blood flow forth about my spear.\"'),(172,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.303'),(173,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.304-1.305'),(174,'  The son of Peleus went his way to his huts and his balanced ships together with the son of Menoetius, and with his men; but the son of Atreus launched a swift ship on the sea, and chose for it twenty rowers, and drove on board a hecatomb for the god, and brought the fair-cheeked daughter of Chryses and set her in the ship;  and Odysseus of many wiles went on board to take command. '),(175,'  The son of Peleus went his way to his huts and his balanced ships together with the son of Menoetius, and with his men; but the son of Atreus launched a swift ship on the sea, and chose for it twenty rowers, and drove on board a hecatomb for the god, and brought the fair-cheeked daughter of Chryses and set her in the ship;  and Odysseus of many wiles went on board to take command. '),(176,'  The son of Peleus went his way to his huts and his balanced ships together with the son of Menoetius, and with his men; but the son of Atreus launched a swift ship on the sea, and chose for it twenty rowers, and drove on board a hecatomb for the god, and brought the fair-cheeked daughter of Chryses and set her in the ship;  and Odysseus of many wiles went on board to take command. '),(177,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.312-1.313'),(178,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.314-1.316'),(179,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.317'),(180,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.318'),(181,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.318-1.321'),(182,' \"Go to the hut of Achilles, Peleus\' son, and take by the hand the fair-cheeked Briseis, and lead her hither; and if he give her not, I will myself go with a larger company and take her; that will be even the worse for him.\"'),(183,' \"Go to the hut of Achilles, Peleus\' son, and take by the hand the fair-cheeked Briseis, and lead her hither; and if he give her not, I will myself go with a larger company and take her; that will be even the worse for him.\"'),(184,' \"Go to the hut of Achilles, Peleus\' son, and take by the hand the fair-cheeked Briseis, and lead her hither; and if he give her not, I will myself go with a larger company and take her; that will be even the worse for him.\"'),(185,' \"Go to the hut of Achilles, Peleus\' son, and take by the hand the fair-cheeked Briseis, and lead her hither; and if he give her not, I will myself go with a larger company and take her; that will be even the worse for him.\"'),(186,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.326'),(187,'  Unwilling went the two along the shore of the barren sea, and came to the tents and the ships of the Myrmidons.'),(188,'  Him they found sitting beside his tent and his black ship; and Achilles was not glad at sight of them.'),(189,'  The two, seized with dread and in awe of the king, stood, and spoke no word to him, nor made question; but he knew in his heart, and spoke:'),(190,' \"Hail, heralds, messengers of Zeus and men, draw near.'),(191,' It is not you who are guilty in my sight, but Agamemnon,  who sent you forth for the sake of the girl, Briseis.'),(192,' It is not you who are guilty in my sight, but Agamemnon,  who sent you forth for the sake of the girl, Briseis.'),(193,'  But come, Patroclus, sprung from Zeus, bring forth the girl, and give her to them to lead away.  However, let these two themselves be witnesses before the blessed gods and mortal men, and before him, that ruthless king, if hereafter  there shall be need of me to ward off shameful ruin from the host.'),(194,'  But come, Patroclus, sprung from Zeus, bring forth the girl, and give her to them to lead away.  However, let these two themselves be witnesses before the blessed gods and mortal men, and before him, that ruthless king, if hereafter  there shall be need of me to ward off shameful ruin from the host.'),(195,'  Truly he rages with baneful mind, and knows not at all to look both before and after, that  his Achaeans might wage war in safety beside their ships.\" '),(196,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.345-1.347'),(197,'  So the two went back beside the ships of the Achaeans, and with them, all unwilling, went the woman.'),(198,'  So the two went back beside the ships of the Achaeans, and with them, all unwilling, went the woman.'),(199,' But Achilles burst into tears, and withdrew apart from his comrades, and sat down on the shore of the grey sea, looking forth over the wine-dark deep.'),(200,'  Earnestly he prayed to his dear mother with hands outstretched:'),(201,' \"Mother, since you bore me, though to so brief a span of life, honour surely ought the Olympian to have given into my hands, Zeus who thunders on high; but now he has honoured me not a bit.'),(202,' Truly the son of Atreus, wide-ruling Agamemnon  has dishonoured me:'),(203,' Truly the son of Atreus, wide-ruling Agamemnon  has dishonoured me:'),(204,' for he has taken and keeps my prize through his own arrogant act.\"'),(205,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.357-1.358'),(206,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.359-1.361'),(207,' What sorrow has come upon your heart?'),(208,' What sorrow has come upon your heart?'),(209,'  Speak out; hide it not in your mind, that we both may know.\"'),(210,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.364'),(211,' \"You know.  Why then should I tell the tale to you who knows all?'),(212,' \"You know.  Why then should I tell the tale to you who knows all?'),(213,'  We went forth to Thebe, the sacred city of Eetion, and laid it waste, and brought here all the spoil.'),(214,' This the sons of the Achaeans divided properly among themselves, but for the son of Atreus they chose out the fair-cheeked daughter of Chryses.  However, Chryses, priest of Apollo, who strikes from afar,  came to the swift ships of the bronze-clad Achaeans, to free his daughter, bearing ransom past counting, and in his hands he held the wreaths of Apollo who strikes from afar, on a staff of gold, and he implored all the Achaeans, but most of all the two sons of Atreus, marshallers of the people.'),(215,' This the sons of the Achaeans divided properly among themselves, but for the son of Atreus they chose out the fair-cheeked daughter of Chryses.  However, Chryses, priest of Apollo, who strikes from afar,  came to the swift ships of the bronze-clad Achaeans, to free his daughter, bearing ransom past counting, and in his hands he held the wreaths of Apollo who strikes from afar, on a staff of gold, and he implored all the Achaeans, but most of all the two sons of Atreus, marshallers of the people.'),(216,'  Then all the rest of the Achaeans shouted assent, to reverence the priest and accept the glorious ransom; yet the thing did not please the heart of Agamemnon, son of Atreus, but he sent him away harshly, and laid upon him a stern command.'),(217,'  Then all the rest of the Achaeans shouted assent, to reverence the priest and accept the glorious ransom; yet the thing did not please the heart of Agamemnon, son of Atreus, but he sent him away harshly, and laid upon him a stern command.'),(218,' So the old man went back again in anger; and Apollo  heard his prayer, for he was very dear to him, and sent against the Argives an evil shaft.'),(219,' So the old man went back again in anger; and Apollo  heard his prayer, for he was very dear to him, and sent against the Argives an evil shaft.'),(220,' Then the people began to die thick and fast, and the shafts of the god ranged everywhere throughout the wide camp of the Achaeans.'),(221,'  But to us the prophet with sure knowledge declared the oracles of the god who strikes from afar. '),(222,' Forthwith, then, I first bade propitiate the god, but thereafter anger seized the son of Atreus, and straightway he arose and spoke a threatening word, which now has come to pass.'),(223,' Forthwith, then, I first bade propitiate the god, but thereafter anger seized the son of Atreus, and straightway he arose and spoke a threatening word, which now has come to pass.'),(224,'  For the quick-glancing Achaeans are taking the maiden in a swift ship to Chryse, and are bearing gifts to the god;  while the other woman the heralds have just now taken from my tent and led away, the daughter of Briseus, whom the sons of the Achaeans gave me.'),(225,'  For the quick-glancing Achaeans are taking the maiden in a swift ship to Chryse, and are bearing gifts to the god;  while the other woman the heralds have just now taken from my tent and led away, the daughter of Briseus, whom the sons of the Achaeans gave me.'),(226,'  But, you, if you are able, guard your own son; go to Olympus and make prayer to Zeus, if ever you have gladdened his heart by word or deed.'),(227,'  But, you, if you are able, guard your own son; go to Olympus and make prayer to Zeus, if ever you have gladdened his heart by word or deed.'),(228,'  For often I have heard you glorying in the halls of my father, and declaring that you alone among the immortals warded off shameful ruin from the son of Cronos, lord of the dark clouds, on the day when the other Olympians wished to put him in bonds, even Hera and Poseidon and Pallas Athene.'),(229,'  But you came, goddess, and freed him from his bonds, when you had quickly called to high Olympus him of the hundred hands, whom the gods call Briareus, but all men Aegaeon; for he is mightier than his father.'),(230,' He sat down by the side of the son of Cronos, exulting in his glory,  and the blessed gods were seized with fear of him, and did not bind Zeus. Bring this now to his remembrance, and sit by his side, and clasp his knees, in hope that he might perhaps wish to succour the Trojans, and for those others, the Achaeans, to pen them in among the sterns of their ships and around the sea as they are slain, so that they may all have profit of their king,  and that the son of Atreus, wide-ruling Agamemnon may know his blindness in that he did no honour to the best of the Achaeans.\"'),(231,' He sat down by the side of the son of Cronos, exulting in his glory,  and the blessed gods were seized with fear of him, and did not bind Zeus. Bring this now to his remembrance, and sit by his side, and clasp his knees, in hope that he might perhaps wish to succour the Trojans, and for those others, the Achaeans, to pen them in among the sterns of their ships and around the sea as they are slain, so that they may all have profit of their king,  and that the son of Atreus, wide-ruling Agamemnon may know his blindness in that he did no honour to the best of the Achaeans.\"'),(232,' He sat down by the side of the son of Cronos, exulting in his glory,  and the blessed gods were seized with fear of him, and did not bind Zeus. Bring this now to his remembrance, and sit by his side, and clasp his knees, in hope that he might perhaps wish to succour the Trojans, and for those others, the Achaeans, to pen them in among the sterns of their ships and around the sea as they are slain, so that they may all have profit of their king,  and that the son of Atreus, wide-ruling Agamemnon may know his blindness in that he did no honour to the best of the Achaeans.\"'),(233,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.413'),(234,'  Would that it had been your lot to remain by your ships without tears and without grief,  since your span of life is brief and endures no long time; but now you are doomed to a speedy death and are laden with sorrow above all men; therefore to an evil fate I bore you in our halls.'),(235,'  Would that it had been your lot to remain by your ships without tears and without grief,  since your span of life is brief and endures no long time; but now you are doomed to a speedy death and are laden with sorrow above all men; therefore to an evil fate I bore you in our halls.'),(236,'  Would that it had been your lot to remain by your ships without tears and without grief,  since your span of life is brief and endures no long time; but now you are doomed to a speedy death and are laden with sorrow above all men; therefore to an evil fate I bore you in our halls.'),(237,'  Yet in order to tell this your word to Zeus who delights in the thunderbolt I will myself go to snowy Olympus, in hope that he may be persuaded.'),(238,'  Yet in order to tell this your word to Zeus who delights in the thunderbolt I will myself go to snowy Olympus, in hope that he may be persuaded.'),(239,'  But remain by your swift, sea-faring ships, and continue your wrath against the Achaeans, and refrain utterly from battle; for Zeus went yesterday to Oceanus, to the blameless Ethiopians for a feast, and all the gods followed with him; but on the twelfth day he will come back again to Olympus,  and then will I go to the house of Zeus with threshold of bronze, and will clasp his knees in prayer, and I think I shall win him.\" '),(240,'  But remain by your swift, sea-faring ships, and continue your wrath ag