off the spits.  Then, when they had ceased from their labour and had made ready the meal, they feasted, nor did their hearts lack anything of the equal feast.  But when they had put from them the desire for food and drink, the youths filled the bowls brim full of drink  and served out to all, first pouring drops for libation into the cups.'),(265,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.474'),(266,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.475-1.476'),(267,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.477-1.478'),(268,'  And Apollo, who works from afar, sent them a favouring wind, and they set up the mast and spread the white sail.'),(269,'  So the wind filled the belly of the sail, and the dark wave sang loudly about the stem of the ship, as she went, and she sped over the wave, accomplishing her way.'),(270,'  But when they came to the wide camp of the Achaeans, they drew the black ship up on the shore,  high upon the sands, and set in line the long props beneath, and themselves scattered among the tents and ships.'),(271,'  But when they came to the wide camp of the Achaeans, they drew the black ship up on the shore,  high upon the sands, and set in line the long props beneath, and themselves scattered among the tents and ships.'),(272,'  But when they came to the wide camp of the Achaeans, they drew the black ship up on the shore,  high upon the sands, and set in line the long props beneath, and themselves scattered among the tents and ships.'),(273,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.488-1.489'),(274,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.490-1.492'),(275,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.493-1.495'),(276,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.495-1.496'),(277,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.497'),(278,'  There she found the far-seeing son of Cronos sitting apart from the rest upon the topmost peak of many-ridged Olympus.  So she sat down before him, and clasped his knees  with her left hand, while with her right she touched him beneath the chin, and she spoke in prayer to king Zeus, son of Cronos:'),(279,'  There she found the far-seeing son of Cronos sitting apart from the rest upon the topmost peak of many-ridged Olympus.  So she sat down before him, and clasped his knees  with her left hand, while with her right she touched him beneath the chin, and she spoke in prayer to king Zeus, son of Cronos:'),(280,' \"Father Zeus, if ever amid the immortals I gave you aid by word or deed, grant me this prayer: do honour to my son, who is doomed to a speedy death beyond all other men;  yet now Agamemnon, king of men, has dishonoured him, for he has taken and keeps his prize by his own arrogant act.'),(281,' \"Father Zeus, if ever amid the immortals I gave you aid by word or deed, grant me this prayer: do honour to my son, who is doomed to a speedy death beyond all other men;  yet now Agamemnon, king of men, has dishonoured him, for he has taken and keeps his prize by his own arrogant act.'),(282,' \"Father Zeus, if ever amid the immortals I gave you aid by word or deed, grant me this prayer: do honour to my son, who is doomed to a speedy death beyond all other men;  yet now Agamemnon, king of men, has dishonoured him, for he has taken and keeps his prize by his own arrogant act.'),(283,' \"Father Zeus, if ever amid the immortals I gave you aid by word or deed, grant me this prayer: do honour to my son, who is doomed to a speedy death beyond all other men;  yet now Agamemnon, king of men, has dishonoured him, for he has taken and keeps his prize by his own arrogant act.'),(284,'  But honour him, Olympian Zeus, lord of counsel; and give might to the Trojans, until the Achaeans do honour to my son, and magnify him with recompense.\"'),(285,'  But honour him, Olympian Zeus, lord of counsel; and give might to the Trojans, until the Achaeans do honour to my son, and magnify him with recompense.\"'),(286,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.511'),(287,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.511-1.512'),(288,' Yet Thetis, even as she had clasped his knees, so held to him, clinging close, and questioned him again a second time: \"Give me your infallible promise, and bow your head to it, or else deny me, for there is nothing to make you afraid; so that I may know well  how far I among all the gods am honoured the least.\"'),(289,' Yet Thetis, even as she had clasped his knees, so held to him, clinging close, and questioned him again a second time: \"Give me your infallible promise, and bow your head to it, or else deny me, for there is nothing to make you afraid; so that I may know well  how far I among all the gods am honoured the least.\"'),(290,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.517'),(291,' \"Surely this will be sorry work, since you will set me on to engage in strife with Hera, when she shall anger me with taunting words.  Even now she always upbraids me among the immortal gods,  and declares that I give aid to the Trojans in battle.'),(292,' \"Surely this will be sorry work, since you will set me on to engage in strife with Hera, when she shall anger me with taunting words.  Even now she always upbraids me among the immortal gods,  and declares that I give aid to the Trojans in battle.'),(293,'  But for the present, depart again, lest Hera note something; and I will take thought for these things to bring all to pass.'),(294,'  But for the present, depart again, lest Hera note something; and I will take thought for these things to bring all to pass.'),(295,'  Come, I will bow my head to you, that thou may be certain, for this from me is the surest token among the immortals;  no word of mine may be recalled, nor is false, nor unfulfilled, to which I bow my head.\"'),(296,'  Come, I will bow my head to you, that thou may be certain, for this from me is the surest token among the immortals;  no word of mine may be recalled, nor is false, nor unfulfilled, to which I bow my head.\"'),(297,'  Come, I will bow my head to you, that thou may be certain, for this from me is the surest token among the immortals;  no word of mine may be recalled, nor is false, nor unfulfilled, to which I bow my head.\"'),(298,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.528'),(299,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.529-1.530'),(300,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.530'),(301,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.531'),(302,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.531-1.533'),(303,'  All the gods together rose from their seats before the face of their father; no one dared to await his coming, but they all rose up before him.'),(304,'  All the gods together rose from their seats before the face of their father; no one dared to await his coming, but they all rose up before him.'),(305,'  So he sat down there upon his throne; but Hera saw, and failed not to note how silver-footed Thetis, daughter of the old man of the sea, had taken counsel with him.'),(306,'  So he sat down there upon his throne; but Hera saw, and failed not to note how silver-footed Thetis, daughter of the old man of the sea, had taken counsel with him.'),(307,'  Forthwith then she spoke to Zeus, son of Cronos, with mocking words:'),(308,' \"Who of the gods, crafty one, has now again taken counsel with you?'),(309,'  Always is it your pleasure to hold aloof from me, and to give judgments which you have pondered in secret, nor have you ever brought yourself with a ready heart to declare to me the matter which you devise.\"'),(310,'  Always is it your pleasure to hold aloof from me, and to give judgments which you have pondered in secret, nor have you ever brought yourself with a ready heart to declare to me the matter which you devise.\"'),(311,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.544'),(312,'  hard will they prove for you, though you are my wife.'),(313,'  hard will they prove for you, though you are my wife.'),(314,'  Whatever it is fitting for you to hear, this none other shall know before you, whether of gods or men; but what I wish to devise apart from the gods, of all this do not in any way inquire nor ask.\"'),(315,'  Whatever it is fitting for you to hear, this none other shall know before you, whether of gods or men; but what I wish to devise apart from the gods, of all this do not in any way inquire nor ask.\"'),(316,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.551'),(317,'  Truly, in the past I have not been accustomed to inquire nor ask you, but at your ease you devise all things whatever you wish. But now I have wondrous dread at heart, lest  silver-footed Thetis, daughter of the old man of the sea, have beguiled you; for at early dawn she sat by you and clasped your knees.'),(318,'  Truly, in the past I have not been accustomed to inquire nor ask you, but at your ease you devise all things whatever you wish. But now I have wondrous dread at heart, lest  silver-footed Thetis, daughter of the old man of the sea, have beguiled you; for at early dawn she sat by you and clasped your knees.'),(319,'  Truly, in the past I have not been accustomed to inquire nor ask you, but at your ease you devise all things whatever you wish. But now I have wondrous dread at heart, lest  silver-footed Thetis, daughter of the old man of the sea, have beguiled you; for at early dawn she sat by you and clasped your knees.'),(320,'  To her, I think, you bowed your head in sure token that you will honour Achilles, and bring many to death beside the ships of the Achaeans.\"'),(321,'  To her, I think, you bowed your head in sure token that you will honour Achilles, and bring many to death beside the ships of the Achaeans.\"'),(322,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.560'),(323,'  \"Strange one, you are always suspecting, and I do not escape you; yet you shall be able to accomplish nothing, but shall be even further from my heart; and that shall be the worse for you.'),(324,'  \"Strange one, you are always suspecting, and I do not escape you; yet you shall be able to accomplish nothing, but shall be even further from my heart; and that shall be the worse for you.'),(325,'  \"Strange one, you are always suspecting, and I do not escape you; yet you shall be able to accomplish nothing, but shall be even further from my heart; and that shall be the worse for you.'),(326,'  If this thing is as you say, then it must be pleasing to me.  Sit down in silence, and obey my word,  lest all the gods that are in Olympus avail you not against my drawing near, when I put forth upon you my irresistible hands.\" '),(327,'  If this thing is as you say, then it must be pleasing to me.  Sit down in silence, and obey my word,  lest all the gods that are in Olympus avail you not against my drawing near, when I put forth upon you my irresistible hands.\" '),(328,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.568-1.569'),(329,'  Then troubled were the gods of heaven throughout the palace of Zeus,  and among them Hephaestus, the famed craftsman, was first to speak, doing pleasure to his dear mother, white-armed Hera:'),(330,'  Then troubled were the gods of heaven throughout the palace of Zeus,  and among them Hephaestus, the famed craftsman, was first to speak, doing pleasure to his dear mother, white-armed Hera:'),(331,' \"Surely this will be sorry work, that is no longer bearable, if you two are to wrangle thus for mortals\' sakes, and set the gods in tumult; neither will there be any joy in the excellent feast,  since worse things prevail.'),(332,' \"Surely this will be sorry work, that is no longer bearable, if you two are to wrangle thus for mortals\' sakes, and set the gods in tumult; neither will there be any joy in the excellent feast,  since worse things prevail.'),(333,'  And I give counsel to my mother, wise though she be herself, to do pleasure to our dear father Zeus, that the father upbraid her not again, and bring confusion upon our feast.  What if the Olympian, the lord of the lightning, were minded  to dash us from our seats!'),(334,'  And I give counsel to my mother, wise though she be herself, to do pleasure to our dear father Zeus, that the father upbraid her not again, and bring confusion upon our feast.  What if the Olympian, the lord of the lightning, were minded  to dash us from our seats!'),(335,' for he is mightiest far.'),(336,'  But address him with gentle words; so shall the Olympian forthwith be gracious to us.\"'),(337,'  But address him with gentle words; so shall the Olympian forthwith be gracious to us.\"'),(338,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.584-1.585'),(339,'  \"Be patient, my mother, and endure for all your grief, lest, dear as you are to me, my eyes see you stricken, and then I shall in no way be able to succour you for all my sorrow; for a hard foe is the Olympian to meet in strife.'),(340,'  On a time before this, when I was striving to save you,  he caught me by the foot and hurled me from the heavenly threshold; the whole day long I was carried headlong, and at sunset I fell in Lemnos, and but little life was in me.'),(341,'  On a time before this, when I was striving to save you,  he caught me by the foot and hurled me from the heavenly threshold; the whole day long I was carried headlong, and at sunset I fell in Lemnos, and but little life was in me.'),(342,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.594'),(343,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.595-1.596'),(344,'  And unquenchable laughter arose among the blessed gods, as they saw Hephaestus puffing through the palace.'),(345,'  And unquenchable laughter arose among the blessed gods, as they saw Hephaestus puffing through the palace.'),(346,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.601-1.604'),(347,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.605-1.608'),(348,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.609-1.610'),(349,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 1.611'),(350,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.1-2.4'),(351,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.5-2.6'),(352,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.7'),(353,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.8'),(354,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.9-2.10'),(355,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.11-2.12'),(356,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.12-2.13'),(357,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.13-2.14'),(358,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.14-2.15'),(359,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.16'),(360,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.17-2.18'),(361,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.18-2.19'),(362,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.20-2.21'),(363,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.22'),(364,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.23'),(365,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.24-2.25'),(366,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.26'),(367,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.perseus-grc1 - 2.26-2.27'),(368,'PLACE HOLDER for: urn:cts:greekLit:tlg0012.tlg001.p